import React from 'react';
import ReactDOM from 'react-dom';
import { Helmet } from 'react-helmet'
import App from './App';

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);

class MyComponent extends React.PureComponent {
  render() {
    {/* ... */}
    return (
      <div>
        <Helmet>
          <title>Hi</title>
          <meta name="title" content="Hi" data-react-helmet="true"/>
        </Helmet>
        {/* ... */}
      </div>
    )
  }
}

